import styled from "styled-components";

const HintBlock = styled.div<{ text: any }>`
  background-color: rgb(19, 24, 35);
  border-radius: 12px;
  margin: 150px auto auto;
  padding: 30px;
  align-self: center;
  width: fit-content;
  text-align: center;
`;

export default HintBlock;
